Array.from(document.getElementsByClassName("menu is-menu-main")).forEach(t=>{Array.from(t.getElementsByClassName("has-dropdown-icon")).forEach(e=>{e.addEventListener("click",s=>{let a=s.currentTarget.getElementsByClassName("dropdown-icon")[0].getElementsByClassName("mdi")[0];s.currentTarget.parentNode.classList.toggle("is-active"),a.classList.toggle("mdi-plus"),a.classList.toggle("mdi-minus")})})});Array.from(document.getElementsByClassName("jb-aside-mobile-toggle")).forEach(t=>{t.addEventListener("click",e=>{let s=e.currentTarget.getElementsByClassName("icon")[0].getElementsByClassName("mdi")[0];document.documentElement.classList.toggle("has-aside-mobile-expanded"),s.classList.toggle("mdi-forwardburger"),s.classList.toggle("mdi-backburger")})});Array.from(document.getElementsByClassName("jb-navbar-menu-toggle")).forEach(t=>{t.addEventListener("click",e=>{let s=e.currentTarget.getElementsByClassName("icon")[0].getElementsByClassName("mdi")[0];document.getElementById(e.currentTarget.getAttribute("data-target")).classList.toggle("is-active"),s.classList.toggle("mdi-dots-vertical"),s.classList.toggle("mdi-close")})});Array.from(document.getElementsByClassName("jb-modal")).forEach(t=>{t.addEventListener("click",e=>{let s=e.currentTarget.getAttribute("data-target");document.getElementById(s).classList.add("is-active"),document.documentElement.classList.add("is-clipped")})});Array.from(document.getElementsByClassName("jb-modal-close")).forEach(t=>{t.addEventListener("click",e=>{e.currentTarget.closest(".modal").classList.remove("is-active"),document.documentElement.classList.remove("is-clipped")})});Array.from(document.getElementsByClassName("jb-notification-dismiss")).forEach(t=>{t.addEventListener("click",e=>{e.currentTarget.closest(".notification").classList.add("is-hidden")})});
